import React, { useState } from "react";
import { ethers } from "ethers";
import { useWallet, ConnectButton } from "@suiet/wallet-kit";

const App = () => {
    const [ethereumAccount, setEthereumAccount] = useState("");
    const [amount, setAmount] = useState("");
    const wallet = useWallet();

    const ETH_CONTRACT_ADDRESS = "0x5FbDB2315678afecb367f032d93F642f64180aa3";
    const ETH_CONTRACT_ABI = [
        {
            "inputs": [],
            "name": "convertETHToIBT",
            "outputs": [],
            "stateMutability": "payable",
            "type": "function"
        },
        {
            "inputs": [
                {"name": "spender", "type": "address", "internalType": "address"},
                {"name": "amount", "type": "uint256", "internalType": "uint256"}
            ],
            "name": "approveTokenForBridge",
            "outputs": [{"name": "", "type": "bool", "internalType": "bool"}],
            "stateMutability": "nonpayable",
            "type": "function"
        },
        {
            "inputs": [
                {"name": "bridgeContract", "type": "address", "internalType": "address"},
                {"name": "amount", "type": "uint256", "internalType": "uint256"}
            ],
            "name": "transferTokensToBridge",
            "outputs": [],
            "stateMutability": "nonpayable",
            "type": "function"
        }
    ];

    const connectEthereumWallet = async () => {
        if (typeof window.ethereum !== "undefined") {
            try {
                const accounts = await window.ethereum.request({
                    method: "eth_requestAccounts",
                });
                setEthereumAccount(accounts[0]);
            } catch (error) {
                console.error("MetaMask connection failed:", error);
            }
        } else {
            alert("MetaMask is not installed!");
        }
    };

    const bridgeToSui = async () => {
        if (!ethereumAccount || !wallet.connected || !amount) {
            alert("Connect both wallets and specify an amount");
            return;
        }

        try {
            const provider = new ethers.providers.Web3Provider(window.ethereum);
            const signer = provider.getSigner();
            const contract = new ethers.Contract(
                ETH_CONTRACT_ADDRESS,
                ETH_CONTRACT_ABI,
                signer
            );

            // Convert ETH to IBT
            console.log("Converting ETH to IBT...");
            const weiAmount = ethers.utils.parseEther(amount);
            const convertTx = await contract.convertETHToIBT({
                value: weiAmount
            });
            await convertTx.wait();
            console.log("ETH converted to IBT");

            // Approve bridge contract
            console.log("Approving bridge contract...");
            const ibtAmount = weiAmount.mul(1000); // Using contract's conversion rate
            const approveTx = await contract.approveTokenForBridge(
                ETH_CONTRACT_ADDRESS,
                ibtAmount
            );
            await approveTx.wait();
            console.log("Bridge contract approved");

            // Transfer IBT to bridge
            console.log("Transferring IBT to bridge...");
            const transferTx = await contract.transferTokensToBridge(
                ETH_CONTRACT_ADDRESS,
                ibtAmount
            );
            await transferTx.wait();
            console.log("IBT transferred to bridge");

            // Mint on Sui side
            console.log("Minting on Sui...");
            const suiTransaction = {
                packageObjectId: "0x9330eb39cba20119511b782e48f2695ab242414e80342b0a69972d0bf4e32298",
                module: "suipart",
                function: "mint",
                arguments: [
                    wallet.address,
                    ethers.utils.parseUnits(amount, 18).toString()
                ],
                gasBudget: 10000
            };

            await wallet.signAndExecuteTransaction({
                transaction: {
                    kind: "moveCall",
                    data: suiTransaction,
                }
            });

            alert("Successfully bridged tokens!");
        } catch (error) {
            console.error("Bridge Error:", error);
            alert(`Bridge failed: ${error.message}`);
        }
    };

    return (
        <div className="flex flex-col items-center justify-center min-h-screen p-4">
            <h1 className="text-2xl font-bold mb-4">Cross-Chain Bridge 🌉</h1>
            <div className="mb-4">
                <button
                    onClick={connectEthereumWallet}
                    className="px-4 py-2 bg-blue-500 text-white rounded shadow"
                >
                    Connect Ethereum Wallet
                </button>
                {ethereumAccount && <p>Connected: {ethereumAccount}</p>}
            </div>
            <div className="mb-4">
                <ConnectButton />
                {wallet.connected && <p>Connected: {wallet.address}</p>}
            </div>
            <div className="mb-4">
                <input
                    type="number"
                    placeholder="Amount in ETH"
                    value={amount}
                    onChange={(e) => setAmount(e.target.value)}
                    className="p-2 border rounded w-64"
                />
            </div>
            <button
                onClick={bridgeToSui}
                className="px-4 py-2 bg-purple-500 text-white rounded shadow"
            >
                Bridge Tokens
            </button>
        </div>
    );
};

export default App;
